  return (
    <body className="text-center">
      <form className="form-signin">
      <img className="mb-4" src="https://www.blueindic.com/blog/wp-content/uploads/2017/04/ticket-01-300x283.png" alt="" width="72" height="72"></img>
      <h1 className="h3 mb-3 font-weight-normal">Please sign in</h1>
      <label for="inputEmail" class="sr-only">Email address</label>
      <input type="email" id="inputEmail" class="form-control" placeholder="Email address" required="" autofocus=""></input>
      <label for="inputPassword" class="sr-only">Password</label>
      <input type="password" id="inputPassword" class="form-control" placeholder="Password" required=""></input>
      <div className="checkbox mb-3">
      <label>
      <label class="sr-only">Remember Me</label>
      <input type="checkbox" value="remember-me"></input>
      </label>
      </div>
      <button className="btn btn-lg btn-primary btn-block" type="submit">Sign in</button>
      <p className="mt-5 mb-3 text-muted">Â© 2017-2019</p>
      </form>
        
    </body>
  
  );
}

export default App;
